(40642, 'B80DE1FF-D32D-41A8-82A6-71B2717917EE', 'Hi love. Headed up the mountain now. Feeling really sad about how many fights we’ve been lately. I️ feel it all over my body this morning and woke up at 5am with such sadness. We never used to argue about logistics and smaller details. I️ hear you loud and clearly on making requests instead of making demands. I️’m going to work on being more conscious about it. I definitely don’t see you as my staff and I️ promise to ask more questions.   I️’d also like to ask for loving help to course correct when I️ don’t get it right. I️n essence, I’m asking for your generosity in giving me the benefit of the doubt. And if something comes out of my mouth that triggers you, please tell me in a kind way and i will try to course correct in the minute. I️ generally don’t try to do things against your will or to disregard your requests. It’s not the way I️ operate. I️ like doing things together with you. If something is off, it’s more likely that it was unclear than me disregarding you. I️ love you to death and I️ generally want to do things for and with you.   I️’m feeling super sad and really heartbroken this morning. The hostile language that’s been coming from you really hurts my heart. It reminds me a lot of my dad and how he engaged with our family. I️ really would fall apart if that kind of tone and language became a norm in the way we communicate. I️ hope you can hear this from a place of love and a real request from my heart to treat me with tenderness. I️ promise I️ will try to do better with the commanding language that triggers you.', '663090417543984896', '663091241406351744', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2022-01-05T07:46:57.543985'),
(40643, '8406BC0E-4723-44A7-975C-A5CEC698A921', 'Also, I️ can’t figure out what Amazon is saying but aric and Johana didn’t get our gifts. I️’m worried that maybe we sent it to the wrong address. Would you mind looking at it to check please. ', '663090862385895936', '663091241406351744', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', '+19172390518', '2022-01-05T07:54:22.385896'),
(40644, '3EBB5DCB-9E9B-4597-9C4C-FD935D3C9D77', 'Thanks love, I am also feeling sad and a bit out of sorts. I Have some reflections that we can talk through during our session with Priscilla. Some of my reactions are just responses to behavior that I don’t like, and possibly some of this has been building. I know we can work through in a loving way and I will honor your tenderness. I appreciate you being vulnerable with me. I love you to death and am so grateful to have had the last few weeks of adventure together. ', '663093552403653376', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'E:nwdave@b-zb.com', 'David', '2022-01-05T08:39:12.403653'),
